# Gowinda summary
	# following - regenerate.gowinda.14feb21.sh, 3pclr_slices_genomicdata_topscores.sh, 3pclr_slices_genomicdata_topscores_secondquantile.sh
#-----------------------------------------------------------------------------------------------------------------------

# Gowinda tests for overrepresentation of a given gene set, compared to the expectation under neutrality, estimated from simulations (Kofler & Schlötterer 2012). 

# Requires as input
	# candidate snp file - chromosome and physical position of target SNPs
	# background snp file -  chromosome and physical position of all SNPs for which a statistic was calculated

# Tests genes which are 1-1 human homologs
	# The homology is important so that we can be very sure that the chimp genes have the same function as the human genes. 

# Run analysis in 'gene' which assumes strong linkage disequilibrium (LD) between SNPs (Kofler & Schlötterer 2012).

# Can test for enrichment in different gene sets
	# different gene sets = different ways of grouping genes together in a (hopefully) biologically meaningful way.

# if running at different quantiles - number of genes at any p threshold is related to both the strength of selection and the number of genes ( polygenic nature ) of a trait 

# fine to run locally

#-----------------------------------------------------------------------------------------------------------------------

# example bash command

## 3) 0.05% candidate target windows - REAC (REAC.biosystems.gene.set_and.all.txt)

## script to run GO enrichment analysis

## directory holding Gowinda-1.12.jar
gowinda="/Volumes/Ultra USB 3.0/UCL/anc.ce.selection/data/gene_enrichment_analyses/chimp_go-2" 
## directory with the GO input files
genesets="/Volumes/Ultra USB 3.0/UCL/anc.ce.selection/data/gene_enrichment_analyses/chimp_go-2" 
## directory with your background and candidate SNP list
input="/Volumes/Ultra USB 3.0/UCL/anc.ce.selection/data/true_genomicdata/3pclr_genome_wide/gene_ontology_input"
## directory to output results.
output="/Volumes/Ultra USB 3.0/UCL/anc.ce.selection/data/true_genomicdata/3pclr_genome_wide/gene_ontology_output"

java -Xmx6g -jar ${gowinda}/Gowinda-1.12.jar \
--snp-file ${input}/final_snp_total_central_eastern_nigeria_3pclr_out_genome_wide.txt \
--candidate-snp-file ${input}/final_snp_subset_central_eastern_3pclr_out_genome_wide_0.0005percent.txt \
--gene-set-file ${genesets}/REAC.biosystems.gene.set_and.all.txt \
--annotation-file ${genesets}/chimp.genes.human.names.homologs.and.amb.homology_mar.17.gtf \
--simulations 50000 \
--min-significance 1 \
--gene-definition updownstream2000 \
--output-file ${output}/REAC.biosystems_geneset_gowindaoutput_snp_subset_central_eastern_3pclr_out_genome_wide_0.0005percent.txt \
--mode gene \
--min-genes 3 \
--threads 4 

##We use the entire gene +- 2kb as our gene definition.
# gowinda is run for 50000 simulations, gene is defined as updownstream2000, in gene mode, requires a minimum of 3 genes per category, min significance of 1 & 4 threads

